import React, {Component, Fragment} from 'react'
import Link from "next/link";
import css from "../../styles/main.scss";
import withSizes from 'react-sizes';


const MainNav = ({isMobile, isTablet}) => (
  <Fragment>
    <header>
      <div className="container">
        <div className="row">
          <nav className={css.navBarFlex}>
            <span className='iconfont icon_bars-light'/>
            <Link href='/'>
              <a className={css.logo}>
                <img className='img-responsive logo_m' src="images/Cali_logo_mobile.png" alt=""/>
              </a>
            </Link>
            <button type="button" className="btn btn-outline-warning">註冊</button>
            <button type="button" className="btn btn-outline-warning">登入</button>
          </nav>
        </div>
      </div>
      <style jsx>
        {
          `
          span.iconfont {
          margin-left: 10px;
            font-size: 1.625rem;
            background: linear-gradient(
              180deg,
              #fdf8a2 3%,
              #f4d97a 47%,
              #eec462 100%
            );
            -webkit-background-clip: text;
            -webkit-text-fill-color: transparent;
          }
          `
        }
      </style>
    </header>
  </Fragment>
);

const mapSizesToProps = ({width}) => ({
  isMobile: width < 480,
  isTablet: width >= 480 && width < 1024
});
export default withSizes(mapSizesToProps)(MainNav);
